import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

interface Product {
  id: number;
  name: string;
  price: number;
  imageUrl: string;
  platform: string;
  originalPrice?: number;
}

const Home: React.FC = () => {
  const [products, setProducts] = useState<Product[]>([]);
  const [loading, setLoading] = useState(true);

  // 模拟数据加载
  useEffect(() => {
    // 模拟API调用
    setTimeout(() => {
      setProducts([
        {
          id: 1,
          name: 'iPhone 15 Pro Max 256GB',
          price: 9999,
          imageUrl: 'https://via.placeholder.com/200x200.png?text=iPhone',
          platform: '淘宝',
          originalPrice: 10999
        },
        {
          id: 2,
          name: 'MacBook Air M2 13英寸',
          price: 8499,
          imageUrl: 'https://via.placeholder.com/200x200.png?text=MacBook',
          platform: '京东',
          originalPrice: 9499
        },
        {
          id: 3,
          name: 'AirPods Pro 第二代',
          price: 1899,
          imageUrl: 'https://via.placeholder.com/200x200.png?text=AirPods',
          platform: '天猫',
          originalPrice: 2299
        },
        {
          id: 4,
          name: 'iPad Air 10.9英寸',
          price: 4399,
          imageUrl: 'https://via.placeholder.com/200x200.png?text=iPad',
          platform: '拼多多',
          originalPrice: 4999
        },
        {
          id: 5,
          name: 'Apple Watch Series 9',
          price: 2999,
          imageUrl: 'https://via.placeholder.com/200x200.png?text=Watch',
          platform: '淘宝',
          originalPrice: 3299
        },
        {
          id: 6,
          name: 'Sony WH-1000XM5 降噪耳机',
          price: 2399,
          imageUrl: 'https://via.placeholder.com/200x200.png?text=Headphones',
          platform: '京东',
          originalPrice: 2999
        }
      ]);
      setLoading(false);
    }, 1000);
  }, []);

  return (
    <div className="home">
      <div className="banner">
        <img 
          src="https://via.placeholder.com/1200x300.png?text=惠购比价-智能比价平台" 
          alt="Banner" 
          className="banner-image"
        />
      </div>

      <div className="categories">
        <h2>热门分类</h2>
        <div className="category-list">
          <div className="category-item">
            <img src="https://via.placeholder.com/80x80.png?text=手机" alt="手机" />
            <span>手机</span>
          </div>
          <div className="category-item">
            <img src="https://via.placeholder.com/80x80.png?text=电脑" alt="电脑" />
            <span>电脑</span>
          </div>
          <div className="category-item">
            <img src="https://via.placeholder.com/80x80.png?text=家电" alt="家电" />
            <span>家电</span>
          </div>
          <div className="category-item">
            <img src="https://via.placeholder.com/80x80.png?text=服饰" alt="服饰" />
            <span>服饰</span>
          </div>
          <div className="category-item">
            <img src="https://via.placeholder.com/80x80.png?text=美妆" alt="美妆" />
            <span>美妆</span>
          </div>
          <div className="category-item">
            <img src="https://via.placeholder.com/80x80.png?text=图书" alt="图书" />
            <span>图书</span>
          </div>
        </div>
      </div>

      <div className="featured-products">
        <h2>推荐商品</h2>
        {loading ? (
          <div className="loading">加载中...</div>
        ) : (
          <div className="product-grid">
            {products.map((product) => (
              <Link to={`/compare?query=${encodeURIComponent(product.name)}`} key={product.id} className="product-card">
                <img src={product.imageUrl} alt={product.name} className="product-image" />
                <div className="product-info">
                  <h3 className="product-name">{product.name}</h3>
                  <div className="product-price">
                    <span className="current-price">¥{product.price}</span>
                    {product.originalPrice && (
                      <span className="original-price">¥{product.originalPrice}</span>
                    )}
                  </div>
                  <div className="platform">{product.platform}</div>
                  {product.originalPrice && (
                    <div className="savings">
                      省¥{product.originalPrice - product.price}
                    </div>
                  )}
                </div>
              </Link>
            ))}
          </div>
        )}
      </div>
    </div>
  );
};

export default Home;
